import React, { useState, useEffect } from "react";
import axios from "axios";
const API = "http://localhost:8000";

export default function App() {
  const [activeTab, setActiveTab] = useState("generate");
  const [ingredients, setIngredients] = useState([]);
  const [ingredient, setIngredient] = useState("");
  const [recipe, setRecipe] = useState(null);
  const [savedList, setSavedList] = useState([]);

  useEffect(() => {
    if (activeTab === "saved") fetchSaved();
  }, [activeTab]);

  const fetchSaved = async () => {
    const resp = await axios.get(`${API}/recipes`);
    setSavedList(resp.data);
  };

  const addIngredient = () => {
    if (!ingredient.trim()) return;
    setIngredients([...ingredients, { name: ingredient }]);
    setIngredient("");
  };

  const generate = async () => {
    const resp = await axios.post(`${API}/generate`, { ingredients });
    setRecipe(resp.data);
  };

  const save = async () => {
    if (!recipe) return;
    await axios.post(`${API}/recipes`, {
      title: recipe.dishName,
      ingredients: recipe.ingredients,
      instructions: recipe.instructions,
    });
    setActiveTab("saved");
  };

  const deleteRecipe = async (id) => {
    await axios.delete(`${API}/recipes/${id}`);
    fetchSaved();
  };

  return (
    <div style={{ padding: 20, fontFamily: "sans-serif" }}>
      <h1>Recipe Generator</h1>
      {/* Tabs */}
      <div style={{ marginBottom: 20 }}>
        <button onClick={() => setActiveTab("generate")} style={{ fontWeight: activeTab==="generate"?"bold":"normal" }}>
          Generate Recipe
        </button>
        <button onClick={() => setActiveTab("saved")} style={{ fontWeight: activeTab==="saved"?"bold":"normal" }}>
          Saved Recipes
        </button>
      </div>

      {activeTab === "generate" && (
        <>
          <input value={ingredient} onChange={e=>setIngredient(e.target.value)} placeholder="Enter ingredient" />
          <button onClick={addIngredient}>Add</button>
          <ul>{ingredients.map((ing,i)=><li key={i}>{ing.name}</li>)}</ul>
          <button onClick={generate} disabled={!ingredients.length}>Generate Recipe</button>
          {recipe && (
            <div style={{ marginTop:20 }}>
              <h2>{recipe.dishName}</h2>
              <h3>Ingredients</h3>
              <ul>{recipe.ingredients.map((ing,i)=><li key={i}>{ing.name}</li>)}</ul>
              <h3>Instructions</h3>
              <ol>{recipe.instructions.map((step,i)=><li key={i}>{step}</li>)}</ol>
              <button onClick={save}>Save Recipe</button>
            </div>
          )}
        </>
      )}

      {activeTab === "saved" && (
        <div>
          <h2>Saved Recipes</h2>
          {savedList.length===0 && <p>No recipes saved.</p>}
          {savedList.map(r=>(
            <div key={r.id} style={{ border:"1px solid #ccc", padding:10, marginBottom:10 }}>
              <h3>{r.dishName}</h3>
              <h4>Ingredients:</h4>
              <ul>{r.ingredients.map((ing,i)=><li key={i}>{ing.quantity?`${ing.quantity} of ${ing.name}`:ing.name}</li>)}</ul>
              <h4>Instructions:</h4>
              <ol>{r.instructions.map((step,i)=><li key={i}>{step}</li>)}</ol>
              <button onClick={()=>deleteRecipe(r.id)}>Delete</button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
